import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 29.1-547 Trapping, selling, purchasing, etc., migratory game birds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-547.md","filePath":"vacode/29.1-547.md"}'),t={name:"vacode/29.1-547.md"},n=i('<h1 id="§-29-1-547-trapping-selling-purchasing-etc-migratory-game-birds" tabindex="-1">§ 29.1-547 Trapping, selling, purchasing, etc., migratory game birds. <a class="header-anchor" href="#§-29-1-547-trapping-selling-purchasing-etc-migratory-game-birds" aria-label="Permalink to &quot;§ 29.1-547 Trapping, selling, purchasing, etc., migratory game birds.&quot;">​</a></h1><p>Notwithstanding the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/29.1-546/" target="_blank" rel="noreferrer">29.1-546</a> and <a href="http://law.lis.virginia.gov/vacode/29.1-553/" target="_blank" rel="noreferrer">29.1-553</a>, any person convicted of trapping or attempting to trap any migratory game bird, as defined in § <a href="http://law.lis.virginia.gov/vacode/29.1-100/" target="_blank" rel="noreferrer">29.1-100</a>, or convicted of possessing any such migratory game bird taken by means of a trap, shall be guilty of a Class 1 misdemeanor. Any person convicted of offering for sale, selling, offering to purchase, or purchasing any migratory game bird shall be subject to penalties as provided in § <a href="http://law.lis.virginia.gov/vacode/29.1-553/" target="_blank" rel="noreferrer">29.1-553</a>.</p><p>1960, c. 173, § 29-161.1; 1987, c. 488; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0848" target="_blank" rel="noreferrer">848</a>.</p>',3),o=[n];function s(g,l,c,p,d,_){return a(),r("div",null,o)}const m=e(t,[["render",s]]);export{f as __pageData,m as default};
